rava respektuje vlastnosti dřeva, je  pružná, pohybuje se dřevem a proto nepopraská. Na výběr je z několika  odstínů lazur, celé škály barev RAL nebo transparantní povrchové úpravy.</p>\r\n<p>TŘÍVRSTVÁ POVRCHOVÁ ÚPRAVA SPOČÍVÁ:</p>\r\n<ul>\r\n    <li>hloubková impregnace ponořením v namáčecí vaně (ochrana proti houbám a plísním)</li>\r\n    <li>barevná impregnace ponořením v namáčecí vaně (podtonování pod vrchní lazuru)</li>\r\n    <li>vysokotlakém nanesení jedné vrstvy lazury o tloušťce 300 mikronů.</li>\r\n</ul>\r\n</div>',NULL,NULL,'',0,NULL,'',''),(1767,7,'92 Zasklení','<p>&#160;</p>\r\n<h1>Zasklení</h1>\r\n<p>Špaletová okna jsou osazena izolačními dvojskly nebo jednoduchými  skly, nejčastější jsou tyto jejich kombinace ve venkovním a vnitřním  křídle:</p>\r\n<table cellspacing=\"0\" cellpadding=\"0\" border=\"1\" class=\"MsoNormalTable\" style=\"border-collapse:collapse;border:none;mso-border-alt:solid windowtext .5pt;\r\n    mso-yfti-tbllook:1184;mso-padding-alt:0cm 5.4pt 0cm 5.4pt;mso-border-insideh:\r\n    .5pt solid windowtext;mso-border-insidev:.5pt solid windowtext\">\r\n    <tbody>\r\n        <tr style=\"mso-yfti-irow:0;mso-yfti-firstrow:yes\">\r\n            <td width=\"205\" rowspan=\"2\" style=\"width:153.5pt;border:solid windowtext 1.0pt;\r\n            mso-border-alt:solid windowtext .5pt;padding:0cm 5.4pt 0cm 5.4pt\">\r\n            <p class=\"MsoNormal\"><span style=\"font-size:10.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">Profil   okna</span></p>\r\n            </td>\r\n            <td width=\"409\" valign=\"top\" colspan=\"2\" style=\"width:307.1pt;border:solid windowtext 1.0pt;\r\n            border-left:none;mso-border-left-alt:solid windowtext .5pt;mso-border-alt:\r\n            solid windowtext .5pt;padding:0cm 5.4pt 0cm 5.4pt\">\r\n            <p align=\"center\" class=\"MsoNormal\" style=\"text-align:center\"><span style=\"font-size:10.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">Varianty   kombinací zaskl