fáme, že naši odbornost a přístup k zákazníkovi budete mít příležitost ocenit i Vy.<br />\r\n<br />\r\nDveře, zárubně, okna a příslušné kování dodáváme od mnoha výrobců. Naleznete u nás dveře dřevěné z masivního dřeva, dýhované, foliované, laminované, ocelové, plechové, hliníkové, plastové, celoskleněné.<br />\r\n<br />\r\nDle způsobu otevírání nabízíme dveře otočné, posuvné, skládací, oboustranně otevíravé, harmonikové, kyvné.<br />\r\n<br />\r\nDle užití a speciálních požadavků nabízíme <a href=\"javascript:void(0);/*1228169526711*/\">dveře vstupní</a> do bytových domů, rodinných domů či bytů buď jako dřevěné, plastové, hliníkové nebo <a href=\"javascript:void(0);/*1228169667466*/\">bezpečnostní</a>, <a href=\"javascript:void(0);/*1228169769833*/\">vnitřní dveře</a>, <a href=\"javascript:void(0);/*1228169981437*/\">protipožární</a>, <a href=\"javascript:void(0);/*1228170303066*/\">protihlukové</a>, kouřotěsné, rentgenové garážová vrata.<br />\r\n<br />\r\n<a href=\"javascript:void(0);/*1228169475999*/\">Posuvné dveře</a> se mohou posouvat do stavebních pouzder nebo po stěně.<br />\r\n<br />\r\nSpolečnost ANTREA, s.r.o. má smlouvy o obchodním zastoupení nebo spolupracuje s výrobci SAPELI, Barausse, Loprais, MRB (Bedex), Cobra, Colombo, MaT, Holar, Rostex, FAB – ASSA Abloy, Mito, Dierre, GEZE, Dorma, Jakov, Lualdi, Cociff, Gardessa, EP-Porte, 2000, Chiuserre, Hapines, FSB, Olivari, JaP, Eclisse, Cooplegno, Mul-t-lock, EVVA, Guard, Bera, Entrysystems, Richter, Martinelli, Mandelli, Hope, Metalia a dalšími.<br />\r\n<br />\r\nV menší míře dodáváme a montujeme take dřevěná, hliníková a plastová okna PKS, plovoucí podlahy Egger a kancelářský nábytek Exner.</p>',NULL,NULL,'',8392,'','',''),(1734,7,'Pouzdro dvoukřídlé zdivo 700+700/1970 tl. zdi 125','<p><b>Stavební pouzdro pro dvoukřídlé posuvné dveře</b></p>\r\n<p>pro zděnou příčku tloušťky 125 mm</p>',NULL,NULL,'',0,NULL,'',''),(1735,7,'Pouzdro dvoukřídlé zdivo 700+700/1970 tl. zdi 108','<p><b>Stavební pouzdro pro dvouk