vsidvere.cz/dealer-antrea\"><img alt=\"\" src=\"data:image/png;base64,\" /></a></p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>Dveře a zárubně značek <a href=\"http://www.dvere.com/dvere-interierove-dvere-sapeli-c-243_32.html\">Sapeli</a>, <a href=\"http://www.dvere.com/dvere-interierove-dvere-lualdi-c-243_112.html\">Lualdi</a>, <a href=\"http://www.dvere.com/bezpecnostni-dvere-bezpecnostni-dvere-bedex-c-257_38.html\">Bedex</a>, <a href=\"http://www.dvere.com/loprais-dvere-z-masivu-c-241.html\">Loprais</a>, <a href=\"http://www.dvere.com/dvere-interierove-dvere-ferrerolegno-c-243_268.html\">FerreroLegno</a> Ferwall, Janošík, Masonite, Solodoor</p>\r\n<p>&#160;od těchto a mnoha dalších výrobců<a href=\"http://www.dvere.com/loprais-dvere-z-masivu-loprais-dvere-vchodove-c-241_52.html\"> vstupní</a> dveře do bytu i do domu a <a href=\"http://www.dvere.com/dvere-interierove-c-243.html\">interiérové</a> dveře, které se hodí do každého domu: dveře dřevěné z <a href=\"http://www.dvere.com/dvere-z-masivniho-dreva-c-241.html\">masivního dřeva</a>, dveře <a href=\"http://www.dvere.com/dvere-vnitrni-c-243.html\">dýhované</a>,<a href=\"http://www.dvere.com/dvere-vnitrni-dvere-sapeli-c-243_32.html\">foliované</a>, <a href=\"http://www.dvere.com/dvere-sapeli-dvere-odolne-c-243_32_230.html\">laminované</a>, dveře <a href=\"http://www.dvere.com/protipozarni-dvere-c-39.html\">ocelové</a>, <a href=\"http://www.dvere.com/protipozarni-dvere-c-39.html\">plechové</a>, hliníkové, plastové či <a href=\"http://www.dvere.com/dvere-sapeli-celosklenene-c-243_32_235.html\">celoskleněné</a>.</p>\r\n<p>Dle způsobu otevírání nabízíme dveře otočné, <a href=\"http://www.dvere.com/dvere-lualdi-drive-posuvne-dvere-c-243_112_225.html\">posuvné</a>, skládací, oboustranně otevíravé, harmonikové, kyvné. <br />\r\nDle užití a speciálních požadavků nabízíme <a href=\"/dvere-vchodove-c-241.html\">dveře vstupní</a> do bytových domů, rodinných domů či bytů buď jako dřevěné, plastové, hliníkové nebo podle použití <a href=\"http://www.dvere.com/bezpecnostni-dvere-c-257.html\">bezpečnostní</a>, <a href=\"http://www.dvere.com/dvere-vnitrni-c-243.html\">vnitřní dveře</a>, <a href=\"/protipozarni-dvere-c-39.html\">protipožární</a>,&#160; <a href=\"http://www.dvere.com/dvere-sapeli-sapeli-zvukove-izolacni-c-243_32_50.html\">protihlukové</a>, kouřotěsné, <a href=\"http://www.dvere.com/dvere-sapeli-sapeli-rtg-dvere-c-243_32_49.html\">rentgenové</a> garážová vrata.  <a href=\"http://www.dvere.com/dvere-lualdi-drive-posuvne-dvere-c-244_112_225.html\">Posuvné dveře</a> se mohou posouvat do<a href=\"http://www.dvere.com/pouzdra-pro-posuvne-dvere-c-242.html\"> stavebních pouzder</a> nebo po stěně.<br />\r\n<br />\r\nSpolečnost Antrea, s.r.o. je certifikovaným prodejcem společnosti&#160; SAPELI,&#160; je společností s mnohaletou zkušeností na trhu v oblasti prodeje a montáží výplní otvorů - dveří, oken. Provádíme také stavební rekonstrukce a stavby menšíhho rozsahu - byty, RD, kanceláře, projekční činost.</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<h2>&#160;<a href=\"http://www.ferrerolegnoporte.it/porte/cze/cerca_porta.php\">Najděte svoje dveře Ferrero Legno ve třech krocích</a></h2>\r\n<p>&#160;</p>\r\n<h2>&#160;</h2>\r\n<h2>Vzorková prodejna:&#160;</h2>\r\n<p>&#160;</p>\r\n<p>Velvarská 33, Praha 6</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p><a href=\"http://www.dvere.com/dvere-vnitrni-dvere-lualdi-c-243_112.html\"><img width=\"167\" height=\"180\" title=\"Dveře Lualdi Outline\" alt=\"Dveře Lualdi Outline\" src=\"/Image/ut.jpg\" /><img width=\"255\" height=\"180\" title=\"Dveře Lualdi Rasomuro\" alt=\"Dveře Lualdi Rasomuro\" src=\"/Image/descrizione.jpg\" /></a></p>\r\n<h2>&#160;</h2>\r\n<h2>Internetový obchod:</h2>\r\n<p>Lze nakupovat nerezové kování českého výrobce Holar, kování M&amp;T s kulatýlmi a oválnými rozetami , pouzdra pro posuvné dveře italského výrobce Eclisse a českého výrobce JAP.</p>\r\n<p><a href=\"http://www.dvere.com/ocelove-plechove-dvere-plechove-zk-dvere-%C3%82%C2%A8bedex-eshop-c-39_344.html\"><b>Nově lze nakupovat pohodlně v našem e-shopu plechové ZK dveře!</b></a></p>\r\n<p>Lze koupit dveře plechové ZK z pozinkovaného plechu bez povrchové úpravy neizolované nebo izolované, dále plechové dveře se základovou barvou šedou.</p>\r\n<h3><a href=\"http://www.facebook.com/photo.php?v=364494816915323\">Natočili nás</a>: <b>podíleli jsme se na tvorbě reportáže v pořadu Rady ptáka Loskutáka</b></h3>\r\n<p>&#160;</p>\r\n<h2>&#160;</h2>\r\n<h3>Na našem webu naleznete prezentaci produktů <a href=\"http://www.dvere.com/na-nasem-webu-naleznete-c-314.html\">těchto výrobců</a></h3>\r\n<p>&#160;</p>\r\n<h3>U nás se domluvíte anglicky/ we speak English</h3>\r\n<p>&#160;</p>\r\n<h3>Novinky</h3>\r\n<p>&#160;</p>\r\n<p>4.8.2013 dveře Sapeli je možné koupit <a href=\"http://www.dvere.com/dvere-sapeli-na-splatky-c-355.html\">na splátky</a> ve spolupráci se společností Home Credit, je možné koupit dveře na splátky i bez navýšení</p>\r\n<p>25.6.2012 na Facebooku naleznete naše nové stránky zaměřené na jednotlivé výrobce, které zastupujeme:</p>\r\n<p><a href=\"https://www.facebook.com/Lualdi.cz\">Dveře Lualdi</a>, <a href=\"https://www.facebook.com/ferrerolegnoCZ\">dveře Ferrero Legno</a>, <a href=\"https://www.facebook.com/pages/Sapeli/426359017448344\">dveře Sapeli</a></p>\r\n<p>18.3.2012 Na Facebooku naleznete <a href=\"http://www.facebook.com/photo.php?v=364494816915323\">reportáž z pořadu Rady ptáka Loskutáka</a>, na níž jsme se podíleli, poskytne Vám základní orientaci ve světě dveří a zárubní</p>\r\n<p>&#160;</p>\r\n<p>15.3.2012 Novinka v nabídce DVERE.COM - dveře <a href=\"http://www.dvere.com/dvere-interierove-dvere-masonite-c-243_333.html\">MASONITE</a></p>\r\n<p>14.3.2012 NOVĚ JSME ZAŘADILI DO NABÍDKY <a href=\"http://www.dvere.com/okna-spaletova-okna-janosik-c-248_331.html\">ŠPALETOVÁ OKNA JANOŠÍK</a></p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;google599d3792be976f11.html</p>',NULL,NULL,'',0,NULL,'',''),(1798,7,'Dveře Bedex ZK plechové hladké pozink bez p.ú. 600/1970/L','<p>&#160;</p>\r\n<h2>ZK PLECHOVÉ DVEŘE</h2>\r\n<p>ZK plechové dveře jsou tvarovou obdobou klasických dřevěných dveří,  skládají se ze dvou částí: užší části (vany) a širší části (víka). Jsou  hladké, bez požární odolnosti. Jednokřídlové jsou standardně vyrobeny z  pozinkovaného plechu o síle 0,55 mm (lze použít i plech 0,8 za příplatek  450,-), dvoukřídlé jsou vyrobeny vždy z pozinkovaného plechu 0,8mm,  který zaručuje vysokou odolnost proti korozi a umožňuje použití téměř  všech povrchových úprav. Dveře jsou osazeny zámkem FAB 190/140 (rozteč  72 mm). V místě závěsů jsou dveře zesíleny dřevěnými a u zámku  plastovými výztuhami. Ocelový plášť je vyplněn papírovou voštinou. Dveře  jsou atestovány na tepelnou a zvukovou propustnost. Tyto atesty platí  pouze pro dveře jednokřídlové.&#160;<span class=\"Apple-style-span\" style=\"font-family: Arial\">Dveře jsou osazeny dveřními závěsy 80/10 VD M8 Ni.</span></p>\r\n<p>ZK plechové dveře lze vyrobit i jako dvoukřídlové, fixace pasivního křídla je zajištěna zadlabacími zastrčeni.</p>\r\n<p class=\"red\">Vážená neprůzvučnost dle ČSN EN ISO140 - 3, ČSN EN ISO 717 - 1:</p>\r\n<p>a) dveře a zárubeň bez prahu - Rw(C;Ctr) =26 (-1; -3) dB</p>\r\n<p class=\"red\">Vážená neprůzvučnost dle ČSN EN ISO140 - 3, ČSN EN ISO 717 - 1:</p>\r\n<p>b) dveře a zárubeň s prahem - Rw(C;Ctr) =30 (-1; -3) dB</p>\r\n<p>&#160;</p>\r\n<p>Dodací lhůta 3-10 dní</p>\r\n<p>&#160;</p>',NULL,NULL,'',0,NULL,'',''),(1751,7,'Equa / I','<p>&#160;</p>',NULL,NULL,'',0,NULL,'',''),(1752,7,'Equa / 2','<p>&#160;</p>',NULL,NULL,'',0,NULL,'',''),(1753,7,'Equa / 6','<p>&#160;</p>',NULL,NULL,'',0,NULL,'',''),(1754,7,'Nexa','<p>&#160;</p>',NULL,NULL,'',0,NULL,'',''),(1755,7,'Nexaglass','<p>&#160;</p>',NULL,NULL,'',0,NULL,'',''),(1756,7,'Nexa/I','<p>&#160;</p>',NULL,NULL,'',0,NULL,'',''),(1757,7,'1. Profily','<p>&#160;</p>\r\n<h1>PROFILY</h1>\r\n<p>Základní nabídku špaletových oken tvoří čtyři profily, profil okna je  možno také vyrobit na základě dodaných výkresů nebo dle původního okna  jako přesnou kopii včetně všech ozdobných prvků.</p>\r\n<ol>\r\n    <li>castle - standardní špaletové okno</li>\r\n    <li>duplik - nejstarší profil špaletových oken, kde se křídla otvírají na opačné strany</li>\r\n    <li>slim - špaletová okno v kombinaci se zúženým eurooknem má vynikající izolační a zvukové vlastnosti</li>\r\n    <li>neoold - standardní profil špaletového okno s celoobvodovým kováním</li>\r\n    <li>rustikal - eurookno s rustikálními prvky pro historicky  stylizované budovy, nebo historické budovy, kde památková péče poleví s  požadavků na špaletová okna</li>\r\n</ol>\r\n<div class=\"border\"><a title=\"pro zvětšení klikněte\" target=\"_blank\" class=\"galleryslide\" href=\"http://www.spaletova-okna.com/root/sortiment/profily/castle,-neoold.jpg\"><img height=\"108\" title=\"castle pro zvětšení klikněte\" alt=\"castle\" src=\"http://www.spaletova-okna.com/root/sortiment/profily/spaletova_okna_castle.png\" /></a><a title=\"pro zvětšení klikněte\" target=\"_blank\" class=\"galleryslide\" href=\"http://www.spaletova-okna.com/root/sortiment/profily/duplik.jpg\"><img height=\"108\" title=\"duplik pro zvětšení klikněte\" alt=\"duplik\" src=\"http://www.spaletova-okna.com/root/sortiment/profily/spaletova_okna_duplik.png\" /></a><a title=\"pro zvětšení klikněte\" target=\"_blank\" class=\"galleryslide\" href=\"http://www.spaletova-okna.com/root/sortiment/profily/slim.jpg\"><img height=\"108\" title=\"slim pro zvětšení klikněte\" alt=\"slim\" src=\"http://www.spaletova-okna.com/root/sortiment/profily/spaletova_okna_slim.png\" /></a><a title=\"pro zvětšení klikněte\" target=\"_blank\" class=\"galleryslide\" href=\"http://www.spaletova-okna.com/root/sortiment/profily/castle,-neoold.jpg\"><img height=\"108\" title=\"neoold pro zvětšení klikněte\" alt=\"neoold\" src=\"http://www.spaletova-okna.com/root/sortiment/profily/spaletova_okna_neoold.png\" /></a><img height=\"108\" title=\"rustikal pro zvětšení klikněte\" alt=\"rustikal\" src=\"http://www.spaletova-okna.com/root/sortiment/profily/rustikalni_okno_rustikal.png\" /></div>',NULL,NULL,'',0,NULL,'',''),(1758,7,'2. Poutce','<h1>POUTCE</h1>\r\n<p>Poutec špaletového okna může být ozdoben buď připevněnou speciální  okrasnou lištou nebo drážkami o různých rozměrech v různých rozestupech  vyfrézovanými přímo v poutci. Základní tvary ozdobných poutců jsou  uvedeny níže. Vybírat ale nemusíte jen z naší nabídky, okrasu na poutec  umíme také vyrobit podle dodaných výkresů nebo podle vzorku původního  okna.</p>\r\n<div class=\"border\"><a title=\"pro zvětšení klikněte\" target=\"_blank\" class=\"galleryslide \" href=\"http://www.spaletova-okna.com/root/sortiment/poutce/2a.png\"><img height=\"108\" title=\"OP0 pro zvětšení klikněte\" alt=\"OP0\" src=\"http://www.spaletova-okna.com/root/sortiment/poutce/2.png\" /></a><a title=\"pro zvětšení klikněte\" target=\"_blank\" class=\"galleryslide\" href=\"http://www.spaletova-okna.com/root/sortiment/poutce/5a.png\"><img height=\"108\" title=\"OP2 pro zvětšení klikněte\" alt=\"OP2\" src=\"http://www.spaletova-okna.com/root/sortiment/poutce/5.png\" /></a><a title=\"pro zvětšení klikněte\" target=\"_blank\" class=\"galleryslide\" href=\"http://www.spaletova-okna.com/root/sortiment/poutce/7a.png\"><img height=\"108\" title=\"OP4 pro zvětšení klikněte\" alt=\"OP4\" src=\"http://www.spaletova-okna.com/root/sortiment/poutce/7.png\" /></a><a title=\"pro zvětšení klikněte\" target=\"_blank\" class=\"galleryslide\" href=\"http://www.spaletova-okna.com/root/sortiment/poutce/10a.png\"><img height=\"108\" title=\"OP5 pro zvětšení klikněte\" alt=\"OP5\" src=\"http://www.spaletova-okna.com/root/sortiment/poutce/10.png\" /></a><a title=\"pro zvětšení klikněte\" target=\"_blank\" class=\"galleryslide\" href=\"http://www.spaletova-okna.com/root/sortiment/poutce/4a.png\"><img height=\"108\" title=\"OP6 pro zvětšení klikněte\" alt=\"OP6\" src=\"http://www.spaletova-okna.com/root/sortiment/poutce/4.png\" /></a><a title=\"pro zvětšení klikněte\" target=\"_blank\" class=\"galleryslide\" href=\"http://www.spaletova-okna.com/root/sortiment/poutce/8a.png\"><img height=\"108\" title=\"OP7 pro zvětšení klikněte\" alt=\"OP7\" src=\"http://www.spaletova-okna.com/root/sortiment/poutce/8.png\" /></a><a title=\"pro zvětšení klikněte\" target=\"_blank\" class=\"galleryslide\" href=\"http://www.spaletova-okna.com/root/sortiment/poutce/6a.png\"><img height=\"108\" title=\"OP8 pro zvětšení klikněte\" alt=\"OP8\" src=\"http://www.spaletova-okna.com/root/sortiment/poutce/6.png\" /></a><img height=\"108\" title=\"OP9 pro zvětšení klikněte\" alt=\"OP9\" src=\"http://www.spaletova-okna.com/root/sortiment/poutce/3.png\" /></div>\r\n<p>&#160;</p>',NULL,NULL,'',0,NULL,'',''),(1674,7,'Pouzdro standard SDK 600/1970/125','<p>&#160;</p>',NULL,NULL,'',0,NULL,'',''),(1675,7,'Pouzdro standard zdivo 600/1970/125','<p>&#160;</p>',NULL,NULL,'',0,NULL,'',''),(1676,7,'Pouzdro standard SDK 700/1970/125','<p>&#160;</p>',NULL,NULL,'',0,NULL,'',''),(1677,7,'Pouzdro standard zdivo 700/1970/125','<p>&#160;</p>',NULL,NULL,'',0,NULL,'',''),(1678,7,'Pouzdro standard zdivo 800/1970/125','<p>&#160;</p>',NULL,NULL,'',0,NULL,'',''),(1679,7,'Pouzdro standard SDK 800/1970/125','<p>&#160;</p>',NULL,NULL,'',0,NULL,'',''),(1680,7,'Pouzdro standard SDK 900/1970/125','<p>&#160;</p>',NULL,NULL,'',0,NULL,'',''),(1681,7,'Pouzdro standard zdivo 900/1970/125','<p>&#160;</p>',NULL,NULL,'',0,NULL,'',''),(1682,7,'Pouzdro standard zdivo 1000/1970/125','<p>&#160;</p>',NULL,NULL,'',0,NULL,'',''),(1683,7,'Pouzdro standard SDK 1000/1970/125','<p>&#160;</p>',NULL,NULL,'',0,NULL,'',''),(1684,7,'Pouzdro standard zdivo 1100/1970/125','<p>&#160;</p>',NULL,NULL,'',0,NULL,'',''),(1685,7,'Pouzdro standard SDK 1100/1970/125','<p>&#160;</p>',NULL,NULL,'',0,NULL,'',''),(1686,7,'Pouzdro standard SDK 1200/1970/125','<p>&#160;</p>',NULL,NULL,'',0,NULL,'',''),(1687,7,'Pouzdro standard zdivo 1200/1970/125','<p>&#160;</p>',NULL,NULL,'',0,NULL,'',''),(1759,7,'3. Klapačky','<p>&#160;</p>\r\n<h1>KLAPAČKY</h1>\r\n<p>Historický vzhled dávají špaletovým oknům rovněž ozdobné klapačky  nejrůznějších rustikálních profilů. Kromě klapaček z naší nabídky umíme  vyrobit také jiné profily buď podle dodaných výkresů nebo podle vzorku  původního okna.</p>\r\n<div class=\"border\"><a href=\"http://www.spaletova-okna.com/root/sortiment/klapacky/6a.png\" class=\"galleryslide\" target=\"_blank\" title=\"pro zvětšení klikněte\"><img height=\"108\" src=\"http://www.spaletova-okna.com/root/sortiment/klapacky/6a-%E2%80%93-kopie.png\" alt=\"OK0\" title=\"OK0 pro zvětšení klikněte\" /></a><a href=\"http://www.spaletova-okna.com/root/sortiment/klapacky/5a.png\" class=\"galleryslide\" target=\"_blank\" title=\"pro zvětšení klikněte\"><img height=\"108\" src=\"http://www.spaletova-okna.com/root/sortiment/klapacky/5a-%E2%80%93-kopie.png\" alt=\"OK1\" title=\"OK1 pro zvětšení klikněte\" /></a><a href=\"http://www.spaletova-okna.com/root/sortiment/klapacky/1a.png\" class=\"galleryslide\" target=\"_blank\" title=\"pro zvětšení klikněte\"><img height=\"108\" src=\"http://www.spaletova-okna.com/root/sortiment/klapacky/1a-%E2%80%93-kopie.png\" alt=\"OK2\" title=\"OK2 pro zvětšení klikněte\" /></a><a href=\"http://www.spaletova-okna.com/root/sortiment/klapacky/4a.png\" class=\"galleryslide\" target=\"_blank\" title=\"pro zvětšení klikněte\"><img height=\"108\" src=\"http://www.spaletova-okna.com/root/sortiment/klapacky/4a-%E2%80%93-kopie.png\" alt=\"OK3\" title=\"OK3 pro zvětšení klikněte\" /></a><a href=\"http://www.spaletova-okna.com/root/sortiment/klapacky/7a.png\" class=\"galleryslide\" target=\"_blank\" title=\"pro zvětšení klikněte\"><img height=\"108\" src=\"http://www.spaletova-okna.com/root/sortiment/klapacky/7a-%E2%80%93-kopie.png\" alt=\"OK4\" title=\"OK4 pro zvětšení klikněte\" /></a><a href=\"http://www.spaletova-okna.com/root/sortiment/klapacky/3a.png\" class=\"galleryslide\" target=\"_blank\" title=\"pro zvětšení klikněte\"><img height=\"108\" src=\"http://www.spaletova-okna.com/root/sortiment/klapacky/3a-%E2%80%93-kopie.png\" alt=\"OK5\" title=\"OK5 pro zvětšení klikněte\" /></a><img height=\"108\" src=\"http://www.spaletova-okna.com/root/sortiment/klapacky/2b-%E2%80%93-kopie.png\" alt=\"OK6\" title=\"OK6 pro zvětšení klikněte\" /></div>',NULL,NULL,'',0,NULL,'',''),(1760,7,'4. Hlavice a patice','<h1>HLAVICE A PATICE</h1>\r\n<p>Velmi významným historizujícím prvkem špaletového okna jsou řezby  hlavic a patic ozdobných klapaček. Hlavice i patice je možno vybírat buď  z nabídky sériově vyráběných tvarů uvedených níže nebo je můžeme ručně  vyřezat podle vzorku původních hlavic či patic.</p>\r\n<div id=\"gallery\">\r\n<h2>replika hlavice dle původní</h2>\r\n<div class=\"border\"><a href=\"http://www.spaletova-okna.com/root/sortiment/profily/hlavice2/2a.png\" class=\"galleryslide\" target=\"_blank\" title=\"pro zvětšení klikněte\"><img height=\"108\" src=\"http://www.spaletova-okna.com/root/sortiment/profily/hlavice2/2b.png\" alt=\"\" title=\" pro zvětšení klikněte\" /></a></div>\r\n<div class=\"border\"><a href=\"http://www.spaletova-okna.com/root/sortiment/profily/hlavice2/p1230028.jpg\" class=\"galleryslide\" target=\"_blank\" title=\"pro zvětšení klikněte\"><img height=\"108\" src=\"http://www.spaletova-okna.com/root/sortiment/profily/hlavice2/p1230028_2.jpg\" alt=\"\" title=\" pro zvětšení klikněte\" /></a></div>\r\n<div class=\"border\"><a href=\"http://www.spaletova-okna.com/root/sortiment/profily/hlavice2/pc100001.jpg\" class=\"galleryslide\" target=\"_blank\" title=\"pro zvětšení klikněte\"><img height=\"108\" src=\"http://www.spaletova-okna.com/root/sortiment/profily/hlavice2/pc100001_2.jpg\" alt=\"\" title=\" pro zvětšení klikněte\" /></a></div>\r\n<div class=\"border\"><a href=\"http://www.spaletova-okna.com/root/sortiment/profily/hlavice2/img_2237.jpg\" class=\"galleryslide\" target=\"_blank\" title=\"pro zvětšení klikněte\"><img height=\"108\" src=\"http: