elnou cenou, tak dveře na vysoké designové  úrovni nebo luxusní úrovni zpracování, či uspokojující vysoké technické  či odolnostní požadavky.  Ke dveřím dodáváme veškeré příslušenství, jako jsou kliky, vložky  do dveří, zárubně, dveřní zavírače, stavební pouzdra  atd., i zde je  možnost výběru obrovská.  <br />\r\nNa požádání lze zřídit vzorkovnu v místě stavby či blízkém okolí pro  větší komfort zákazníků.   <br />\r\nPokud mate zájem, můžeme dovézt či zaslat  katalogy, vzorky, materiály či podrobnější informace o referenčních stavbách.</p>\r\n<p>Jan Sommer, jednatel společnosti<br />\r\n&#160;</p>',NULL,NULL,'',1347,'','',''),(1521,3,'','',NULL,NULL,'',7,'','',''),(1740,7,'Kování na celoskleněné dveře','<h1>Kování pro otočné celoskleněné dveře</h1>\r\n<p>Uvedené ceny jsou bez DPH</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<table width=\"200\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\">\r\n    <tbody>\r\n        <tr>\r\n            <td>\r\n            <p><img width=\"880\" height=\"1115\" align=\"left\" src=\"http://www.sapeli.cz/soubory/Image/AKCE%202011/kovani%20stylus/KOVANI_STYLUS_1.jpg\" alt=\"\" class=\"obsahovy\" /></p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td><img width=\"880\" height=\"1103\" align=\"left\" alt=\"\" src=\"http://www.sapeli.cz/soubory/Image/AKCE%202011/kovani%20stylus/KOVANI_STYLUS_2.jpg\" class=\"obsahovy\" /></td>\r\n        </tr>\r\n        <tr>\r\n            <td><img width=\"880\" height=\"1163\" align=\"left\" alt=\"\" src=\"http://www.sapeli.cz/soubory/Image/AKCE%202011/kovani%20stylus/KOVANI_STYLUS_3.jpg\" class=\"obsahovy\" /></td>\r\n        </tr>\r\n        <tr>\r\n            <td><img width=\"880\" height=\"1205\" align=\"left\" alt=\"\" src=\"http://www.sapeli.cz/soubory/Image/AKCE%202011/kovani%20stylus/KOVANI_STYLUS_4.jpg\" class=\"obsahovy\" /></td>\r\n        </tr>\r\n        <tr>\r\n            <td><img width=\"880\" height=\"1146\" align=\"left\" alt=\"\" src=\"http://www.sapeli.cz/soub