formace','<p><a href=\"/file/Technicke%20informace%20Lualdi/Technicke%20informace.pdf\">Technické informace</a></p>\r\n<p>&#160;</p>',NULL,NULL,'',359,NULL,'',''),(1595,7,'Dveře Outline','<p>&#160;</p>',NULL,NULL,'',72,NULL,'',''),(1596,7,'Dveře Outline','<p>&#160;</p>',NULL,NULL,'',70,NULL,'',''),(1597,7,'Technické informace','<p><a href=\"/rasomuro tech info.pdf\">Rasomuro se základní zárubní</a></p>\r\n<p>Rasomuro s kontrazárubní</p>\r\n<p>Rasomuro do sádrokartonové příčky</p>\r\n<p>&#160;</p>',NULL,NULL,'',117,NULL,'',''),(1765,7,'9. Materiály','<div id=\"main\">\r\n<div id=\"bg\">\r\n<div id=\"main-wrapper\">\r\n<div id=\"content\">\r\n<div id=\"primary-content\">\r\n<h1>Materiály</h1>\r\n<p>Základním materiálem pro výrobu špaletového okna je vícevrstvý lepený  hranol nebo celistvý dřevěný masiv z čistého radiálního řeziva bez suků  a vad. Na ostění se používá spárovka o síle 20mm. Vybírat je možno  z&#160;nabídky pěti různých dřevin.</p>\r\n<ul>\r\n    <li class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n    text-align:justify;mso-list:l0 level1 lfo1;tab-stops:list 36.0pt\"><b style=\"mso-bidi-font-weight:normal\">Smrk </b>-  Nejpoužívanější a      nejlevnější tuzemská dřevina. Dřevo je měkké,  lehké, pevné a v suchu      trvanlivé. Smrkové hranoly zaručují  stabilitu a stálost výrobku. Je      nabízen buď levnější napojované  variantě nebo v&#160;nenapojovaných<span style=\"mso-spacerun:yes\">&#160; </span>fixních délkách (bez cinků)</li>\r\n    <li class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n    text-align:justify;mso-list:l0 level1 lfo1;tab-stops:list 36.0pt\"><b style=\"mso-bidi-font-weight:normal\">Dub</b>  - Tvrdá, pevná a trvanlivá      dřevina na povrchu poréznější. Má horší  tepelně-izolační vlastnosti proti      jehličnatým dřevinám. Je nabízen  buď levnější napojované variantě nebo      v&#160;nenapojovaných<span style=\"mso-spacerun:yes\">&#160; </span>fixních      délkách (bez cinků).</li>\r\n    <li class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n    text-align:justify;mso-list:l0 level1 lfo1;tab-stops:list 36.0pt\"><b style=\"mso-bidi-font-weight:normal\">Meranti </b>-  Exotická tvrdá dřevina      zaručující stabilitu a tvarovou stálost  výrobku. Hranoly se vyrábí pouze v      nenapojovaných lamelách. Barva  dřeva má červeno-hnědý nádech a na povrchu      má dřevo porézní  strukturu. Přírodní vlastností tohoto materiálu je      poměrně významná  rozbarvenost.</li>\r\n    <li class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n    text-align:justify;mso-list:l0 level1 lfo1;tab-stops:list 36.0pt\"><b style=\"mso-bidi-font-weight:normal\">Borovice</b>  - Druhá nejvíce používaná      tuzemská dřevina pro výrobu oken a  dveří. Dřevo má lepší strukturu a      kresbu, pod lazury velmi vhodné,  nedoporučuje se však jeho použití pod      bílou barvu z důvodu  žloutnutí způsobovaného velkým<span style=\"mso-spacerun:yes\">&#160; </span>množstvím pryskyřic obsažených v      dřevině. Je nabízen buď levnější napojované variantě nebo      v&#160;nenapojovaných<span style=\"mso-spacerun:yes\">&#160; </span>fixních      délkách (bez cinků)</li>\r\n    <li class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n    text-align:justify;mso-list:l0 level1 lfo1;tab-stops:list 36.0pt\"><b style=\"mso-bidi-font-weight:normal\">Modřín </b>-  Dřevina ceněná pro své      vlastnosti podobné dubu. Pouze fixní  provedení hranolů. Nevýhodou může být      vysoký obsah pryskyřic, které  se mohou postupem času vyronit na povrch      výrobku</li>\r\n</ul>\r\n<div id=\"gallery\">\r\n<h2>Náhledy dřevin</h2>\r\n<div class=\"border\"><a href=\"http://www.spaletova-okna.com/root/sortiment/dreviny/smrk_hranol.jpg\" class=\"galleryslide\" target=\"_blank\" title=\"pro zvětšení klikněte\"><img height=\"108\" src=\"http://www.spaletova-okna.com/root/sortiment/dreviny/smrk_hranol.jpg\" 