yle=\"font-size:10.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">46dB</span></p>\r\n            </td>\r\n        </tr>\r\n        <tr style=\"mso-yfti-irow:3;mso-yfti-lastrow:yes\">\r\n            <td width=\"154\" valign=\"top\" style=\"width:115.15pt;border:solid windowtext 1.0pt;\r\n            border-top:none;mso-border-top-alt:solid windowtext .5pt;mso-border-alt:solid windowtext .5pt;\r\n            padding:0cm 5.4pt 0cm 5.4pt\">\r\n            <p class=\"MsoNormal\"><span style=\"font-size:10.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">4/10/4</span></p>\r\n            </td>\r\n            <td width=\"154\" valign=\"top\" style=\"width:115.15pt;border-top:none;border-left:\r\n            none;border-bottom:solid windowtext 1.0pt;border-right:solid windowtext 1.0pt;\r\n            mso-border-top-alt:solid windowtext .5pt;mso-border-left-alt:solid windowtext .5pt;\r\n            mso-border-alt:solid windowtext .5pt;padding:0cm 5.4pt 0cm 5.4pt\">\r\n            <p class=\"MsoNormal\"><span style=\"font-size:10.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">4</span></p>\r\n            </td>\r\n            <td width=\"154\" valign=\"top\" style=\"width:115.15pt;border-top:none;border-left:\r\n            none;border-bottom:solid windowtext 1.0pt;border-right:solid windowtext 1.0pt;\r\n            mso-border-top-alt:solid windowtext .5pt;mso-border-left-alt:solid windowtext .5pt;\r\n            mso-border-alt:solid windowtext .5pt;padding:0cm 5.4pt 0cm 5.4pt\">\r\n            <p class=\"MsoNormal\"><span style=\"font-size:10.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">1,1W/m<sup>2</sup>K</span></p>\r\n            </td>\r\n            <td width=\"154\" valign=\"top\" style=\"width:115.15pt;border-top:none;border-left:\r\n            none;border-bottom:solid windowtext 1.0pt;border-right:solid windowtext 1.0pt;\r\n            mso-border-top-alt:solid windowtext .5pt;mso-border-left-alt:solid windowtext .5pt;\r\n            mso-border-alt:solid windowtext .5pt;padding:0cm 5.4pt 0cm 5.4pt\">\r\n            <p class=\"MsoNormal\"><span style=\"font-size:10.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">46dB</span></p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<h2>Součinitel prostupu tepla oknem (U<sub>w</sub>)</h2>\r\n<p>Nejdůležitější technický parametr okna je součinitel prostupu tepla,  vyjadřuje množství tepelné energie, které pronikne oknem. Jeho velikost  je ovlivněna tepelnými vlastnostmi rámu a zasklení. Čím nižší je tedy  hodnota součinitele prostupu tepla, tím lepší jsou tepelně izolační  vlastnosti.</p>\r\n<h2>Zvukový útlum (Rw)</h2>\r\n<p>Významnou vlastností zejména pro objekty v blízkosti rušných  křižovatek, železnic, letišť jsou dokonalé zvukově izolační vlastnosti  oken. Zvýšení zvukově izolačních vlastností se dosahuje využitím různých  typů skel.</p>\r\n<ul>\r\n    <li>Rw = 32dB - STANDART</li>\r\n    <li>Rw = 35dB - V BLÍZKOSTI SILNICE</li>\r\n    <li>Rw = 38dB - U FREKVENTOVANÉ SILNICE</li>\r\n    <li>Rw = 41dB - V BLÍZKOSTI DÁLNICE, LETIŠTĚ NEBO ŽELEZNICE</li>\r\n</ul>',NULL,NULL,'',0,NULL,'',''),(1744,7,'Povrchové úpravy','<p><embed height=\"800\" width=\"500\" menu=\"true\" loop=\"true\" play=\"true\" src=\"/flash/finitureblues.swf\" pluginspage=\"http://www.macromedia.com/go/getflashplayer\" type=\"application/x-shockwave-flash\"></embed></p>',NULL,NULL,'',0,NULL,'',''),(1747,7,'Povrchové úpravy','<p><embed height=\"800\" width=\"500\" type=\"application/x-shockwave-flash\" pluginspage=\"http://www.macromedia.com/go/getflashplayer\" src=\"/flash/finitureswing.swf\" play=\"true\" loop=\"true\" menu=\"true\"></embed></p>',NULL,NULL,'',0,NULL,'',''),(1746,7,'Povrchové úpravy','<p><embed height=\"800\" width=\"500\" type=\"application/x-shockwave-flash\" pluginspage=\"http://www.macromedia.com/go/getflashplayer\" src=\"/flash/finituredrive.swf\" play=\"true\" loop=\"true\" menu=\"true\"></embed>&#160;</p>',NU