čnostní dveře Ferwall','<p><span style=\"font-size: larger;\"><span style=\"font-family: Arial;\">Jsme hlavním zástupcem v České republice výrobce bezpečnostních dveří Ferwall. Dovážíme je, prodáváme a montujeme. Jedná se o  výrobce, který nabízí veliký výběr možného provedení dveří, bezpečnostní třídy 2, 3 a 4. Nabízí se výběr z nezpočetného množství plášťů dveří i  variant technických - zateplené dveře, protipožární, vnitřní, vnější,  protihlukové. Montáž je snadná, ale vyžaduje zednickou úpravu - dveře  mají vždy svou vlastní ocelovou dvoudínou zárubeň.</span></span></p>\r\n<p><a href=\"http://www.ferwall.com/\">ODKAZ NA STRÁNKY VÝROBCE</a></p>\r\n<p><a href=\"/file/cat_ridotto.pdf\">KATALOG DVEŘÍ</a></p>\r\n<p><a href=\"/file/LISTINO%202010.pdf\">CENÍK POVRCHOVÝCH ÚPRAV (EURO)</a></p>\r\n<p><a href=\"/file/Cenik%20dveri%20Ferwall.pdf\">CENÍK DVEŘÍ FERWALL</a></p>\r\n<p>&#160;</p>',NULL,NULL,'',81,NULL,'',''),(1640,7,'sitemap','<p><a href=\"/file/sitemap.xml\">file/sitemap.xml</a></p>',NULL,NULL,'',0,NULL,'',''),(1749,7,'Equa Intarsio','<p>&#160;</p>',NULL,NULL,'',0,NULL,'',''),(1750,7,'Equa Vetro','<p>&#160;</p>',NULL,NULL,'',0,NULL,'',''),(1748,7,'Equa plné hladké','<p>&#160;</p>',NULL,NULL,'',0,NULL,'',''),(1644,7,'Katalog dveří PDF','<p><a href=\"/file/katalog_dveri_hse.pdf\">Katalog dveří PDF</a></p>',NULL,NULL,'',13,NULL,'',''),(1643,7,'Falcové požární dveře HSE','<p>Dveře protipožární falcované se vyrábí plné nebo prosklené v požárních odolnostech EI30, EI45 a EW60. V povrchových úpravách pozink, základní nástřik nebo vrstvený lak (komaxit) v odstínech dle stupnice RAL.</p>\r\n<p><a href=\"/file/cenik_protipoz_dvere%20FALC.pdf\">&#160;CENÍK PROTIPOŽÁRNÍCH FALCOVÝCH DVEŘÍ</a></p>\r\n<h3>Technické popisy dveří:</h3>\r\n<h4>Dveře EI30</h4>\r\n<p>&#160;</p>\r\n<p>Dveře se skládají ze dvou ocelových korpusů vylisované ze žárově                 pozinkovaného plechu o síle 0,60 mm. Výplň dveřního křídla tvoří                 protipožární desky. Konstrukce je v  místě závěsů a zámku zesílena                 ocelovými výztuhami. Dveře jsou standardně dodávány s třemi závěsy V 0020.                 Ve falcu dveří je nalepená vytěsňující pěnící páska.<br />\r\nZK dveře můžeme dodávat v povrchové úpravě - pozink, základní                 nástřik nebo prášková barva dle vzorníku RAL. Protipožární dveře                 jsou dodávány standardně BEZ zárubně.</p>\r\n<p>&#160;</p>\r\n<h4>Dveře EI45</h4>\r\n<p>Dveře se skládají ze dvou ocelových korpusů vylisované ze žárově                 pozinkovaného plechu o síle 0,60 mm. Šířka dveří je 50 mm. Výplň                 dveřního křídla tvoří tři protipožární desky. Konstrukce je v                 místě závěsů a zámku zesílena ocelovými výztuhami. Dveře jsou                 standardně dodávány s dvěmi závěsy VX 7939 / 100. Ve falcu dveří                 je nalepená vytěsňující pěnící páska. Uprostřed dveří je pojistný                 čep, který zapadá do otvoru  v zárubni. Protipožární dveře EI 45                 jsou zkoušeny s atypickou zárubní s hloubkou polodrážky 23,5 mm                 (zárubeň není standardně součástí dodávky protipožárních dveří).                 ZK dveře můžeme dodávat v povrchové úpravě - pozink, základní                 nástřik nebo prášková barva dle vzorníku RAL.</p>\r\n<h4>Dveře EW60</h4>\r\n<p>Dveře se skládají ze dvou ocelových korpusů vylisované ze žárově                 pozinkovaného plechu o síle 0,60 mm. Šířka dveří je 50 mm. Výplň                 dveřního křídla tvoří tři protipožární desky. Konstrukce je v                 místě závěsů a zámku zesílena ocelovými výztuhami. Dveře jsou                 standardně dodávány s dvěmi závěsy VX 7939 / 100. Ve falcu dveří                 je nalepená vytěsňující pěnící páska. Uprostřed dveří je pojistný                 čep, který zapadá do otvoru  v zárubni. Protipožární dveře EI 45                 jsou zkoušeny s atypickou zárubní s hloubkou polodrážky 23,5 mm                 (zárubeň není standardně součástí dodávky protipožárních dveří).                 ZK dveře můžeme dodávat v povrchové úpravě - pozink, základní                 nástřik nebo prášková barva dle vzorníku RAL.</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>',NULL,NULL,'',3016,NULL,'',''),(1645,7,'Bezfalcové požární dveře HSE','<p>&#160;</p>\r\n<p>Dveře protipožární bezfalcové se vyrábí plné nebo prosklené s  požární odolností EI30. V povrchových úpravách pozink,  základní nástřik nebo vrstvený lak (komaxit) v odstínech dle stupnice  RAL.</p>\r\n<div align=\"justify\">\r\n<p class=\"podnadpis\">&#160;</p>\r\n<h3>Technický popis dveří:</h3>\r\n<p class=\"podnadpis\">&#160;</p>\r\n<p>Dveře se skládají ze dvou ocelových korpusů vylisované ze žárově                 pozinkovaného plechu o síle 0,60 mm. Výplň dveřního křídla tvoří                 minerální desky. Konstrukce dveří je v místě závěsů a zámku                 zesílena ocelovými výztuhami. Dveře jsou dodávány s třemi závěsy                 V 7729 / 100. Ve falcu dveří je po obvodu nalepena vytěsňující                 pěnící páska. Dveře jsou zkoušeny s atypickou zárubní s šířkou                 polodrážky 23,5 mm (zárubeň standardně není součástí dodávky).<br />\r\nZK dveře můžeme dodávat v povrchové úpravě - pozink, základní                 nástřik nebo prášková barva dle vzorníku RAL.</p>\r\n</div>\r\n<h4>&#160;</h4>',NULL,NULL,'',21,NULL,'',''),(1647,7,'HSE kompletní ceník','<p><a href=\"/file/cenik_komplet.pdf\">KOMPLETNÍ CENÍK HSE</a></p>',NULL,NULL,'',22,NULL,'',''),(1649,7,'Pouzdro standard SDK 700/1970/100','<p><strong>Stavební pouzdro pro jednokřídlé dveře</strong></p>\r\n<p>&#160;pro montáž do sádrokartonové příčky tloušťky 100 mm</p>',NULL,NULL,'',74,NULL,'',''),(1650,7,'Pouzdro standard SDK 800/1970/100','<p><strong>Stavební pouzdro pro jednokřídlé dveře</strong></p>\r\n<p>pro montáž do sádrokartonové příčky tloušťky 100 mm</p>',NULL,NULL,'',11,NULL,'',''),(1651,7,'Pouzdro standard SDK 900/1970/100','<p><strong>St